import React from "react";


export const Overview = () => {
    return (
        <div className='overview_background'>
            <div className='overview'>
                <h1>Hi, I am Paul</h1>
                <div className='content'>
                    <p>I am a computer science student at Simon Fraser University and an aspiring computer scientist.</p>
                    <img src='/images/overviewPicture.jpeg' alt='A selfie of Paul' />
                    <h3>Contact Me:</h3>
                    <p>Email: paulpaulworld@gmail.com</p>
                </div>
            </div>
        </div>
);
}
